import { Box, Container } from '@mui/system';
import React from 'react';
import { 
    FormControlLabel,
    Checkbox,
    } from '@mui/material';
import { CheckBox } from '@mui/icons-material';

// const Checkbox =() =>{
//     <Checkbox />
// }

const Checkout = () => {
  return (
    <Container>
        <FormControlLabel
          value="selectAll"
          control={<Checkbox />}
          label="Pilih Semua"
          labelPlacement="end"
          sx={{
            gap:'35px',
            mt:'40px'
          }}/>

        <Box
        display='flex'
        flexDirection='row'
        height='157px'
        borderBottom='1px solid #BDBDBD'
        mb='10px'
        >
            <CheckBox/>
            <Box
            component='img'
            src = "./Ramen.png"
            width = '200px'
            height = '133px'
            />

        </Box>
    </Container>
  )
}

export default Checkout
